import { useState } from "react";

export const useWebRTC = () => {
  const [clients, setClients] = useState([
    {
      id: 1,
      name: "Kapil Joshi",
    },
    {
      id: 2,
      name: "Hemant Joshi",
    },
  ]);

  return { clients };
};
